const Titles = {
    OPEN: '1. open',
    HIGH: '2. high',
    LOW: '3. low',
    CLOSE: '4. close',
    VOLUME: '5. volume'
};

const Mode = {
    LONG: 2,
    SHORT: 1,
    NONE: 0
};

const runMethods = () => {
    const parsedData = data.map(record => ({records: record['Time Series (Daily)'], code: record["Meta Data"]['2. Symbol']}));
    
    for (let record of parsedData) {
        let profit = 0;
        let mode = Mode.NONE;

        const daysData = Object.values(record.records).reverse();
        for (let dailyDataIndex = 1; dailyDataIndex < daysData.length; dailyDataIndex++) {
            const dailyData = daysData[dailyDataIndex];
            const previousDailyData = daysData[dailyDataIndex - 1];

            const closePriceNow = +dailyData[Titles.CLOSE];
            const closePriceBefore = +previousDailyData[Titles.CLOSE];

            const diff = closePriceNow - closePriceBefore;

            if (diff > 0 && mode !== Mode.LONG) {
                mode = Mode.LONG;
                profit -= +closePriceNow;
            } else if ( diff < 0 && mode !== Mode.SHORT) {
                mode = Mode.SHORT;
                profit += +closePriceNow;
            }
        }

        const firstDayPrice = daysData[0][Titles.CLOSE];
        const lastDayPrice = daysData[daysData.length - 1][Titles.CLOSE];

        profit = profit.toFixed(3);
        const profitPct =((profit * 100) / firstDayPrice).toFixed(3);

        const longTermInvProfit = (lastDayPrice - firstDayPrice).toFixed(3);
        const longTermInvProfitPct = ((longTermInvProfit * 100) / firstDayPrice).toFixed(3);

        console.log(`${record.code} - the profit is ${profit}$ which is ${profitPct}% from the stock price on the first day`);
        console.log(`${record.code} - Long term investment would get us ${longTermInvProfit}$ profit which is ${longTermInvProfitPct}%
`);
    }
};

const createRawSheetsFile = (fromDate, granularity) => {
    let rawFileData = stocks.join(',,');
    rawFileData += OS.EOL;
    rawFileData += stocks.map(stock => `"=GOOGLEFINANCE(""${stock}"",""Price"",""${fromDate}"",TODAY(),""${granularity}"")"`).join(',,');
    rawFileData += OS.EOL;
    fs.writeFileSync('raw_data.csv', rawFileData);
};

